import React from "react";
import Navigation from "../components/layout/Navigation";

const Comparison = () => {
  return (
    <>
      <div className="parent">
        <div className="main">
          <Navigation />
        </div>
        {/* <Modal selected="compare" /> */}
      </div>
    </>
  );
};

export default Comparison;
